Вмонтированная в стенку подвесная тумба под TV&nbsp;представлена итальянской фабрикой Res Italia&nbsp;в коллекции Zero.&nbsp;Тумба оформлена в современном&nbsp;стиле, ее&nbsp;каркас&nbsp;изготовлен из МДФ в глянцевой&nbsp;отделке.&nbsp;Выполнена с внутренними встроенными полками. Тумба оборудована встроенной подсветкой с&nbsp;Led-освещением, возможен заказ версии без подсветки.&nbsp;Настенная рама под TV в стоимость не входит и рассчитывается дополнительно.&nbsp;Доступен заказ&nbsp;изделия с другими параметрами и в других вариантах отделки&nbsp;(лакированный и матовый)&nbsp;

Фабрика SILIK
Стиль Классический, Барокко, Рококо
Стойка под TV,&nbsp;в стиле барокко, от фабрики SILIK, коллекции Inner Landscapes. Структура выполнена из массива натурального дерева и декорирована крупной, замысловатой &nbsp;резьбой. Отделка - белое золото со светлыми оттенками. Изысканная, несколько вычурная стойка великолепно дополнит ваш интерьер. Заказать данное изделие можно в других вариантах отделки.&nbsp;

