Фабрика ULIVI
Стиль Современный
Тумба в современном стиле, от фабрики&nbsp;ULIVI, коллекции&nbsp;Absolute. Выполнена из дерева (американский орех). Верх тумбы и боковые панели обиты кожей. Имеются ящики. Тумба необычной формы и отделки. Создает ощущение минимализма, но в то же время смотрится оригинально. Эргономичная тумба не только стильно дополнит ваш интерьер, но и послужит качеством и практичностью. Заказать данное изделие можно в других вариантах отделки.&nbsp;

Фабрика ALCHYMIA
Стиль Арт деко, Гламур
Стенка с фасадом, декорированным зеркалом и росписью, выполненной вручную.&nbsp;Оснащена закрытыми полками и нишей под TV.&nbsp;

Фабрика ANTONELLI MORAVIO
Стиль Классический
Изысканная тумба под TV с двумя распашными дверцами и четырьмя вместительными ящиками&nbsp;представлена итальянской фабрикой&nbsp;Antonelli Moravio&nbsp;в коллекции&nbsp;Napoleone. Тумба изготовлена из&nbsp;высококачественного массива дерева. Выполненная&nbsp;в&nbsp;классическом стиле,&nbsp;данная модель&nbsp;украшена утонченной резьбой ручной работы.&nbsp;По желанию клиента&nbsp;возможны&nbsp;другие варианты отделки.
