Фабрика SILIK
Стиль Классический
Тумба под TV в классическом стиле, от фабрики&nbsp;SILIK, коллекции&nbsp;Lo Stile Di Classe. Структура выполнена из массива натурального дерева и декорирована художественный резьбой. Отделка - золотая фольга. Тумба оснащена одним ящиком. Столешница со стеклянным топом. Изящная, несколько вычурная тумба великолепно дополнит ваш интерьер. Заказать данное изделие можно в других вариантах отделки.&nbsp;

Фабрика REFLEX
Стиль Современный
Стойка для TV в стиле хай тек, от фабрики REFLEX, коллекции Disegno.&nbsp;Структура - сатинированная сталь, стекло. Стойка оснащена комодом.&nbsp;Возможны различные варианты отделки - без комода или с полкой.&nbsp;
